/*Table structure for table `cms_article_data` */

DROP TABLE IF EXISTS `cms_article_data`;

CREATE TABLE `cms_article_data` (
  `id` varchar(64) COLLATE utf8_bin NOT NULL COMMENT '编号',
  `content` text COLLATE utf8_bin COMMENT '文章内容',
  `copyfrom` varchar(255) COLLATE utf8_bin DEFAULT NULL COMMENT '文章来源',
  `relation` varchar(255) COLLATE utf8_bin DEFAULT NULL COMMENT '相关文章',
  `allow_comment` char(1) COLLATE utf8_bin DEFAULT NULL COMMENT '是否允许评论',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_bin COMMENT='文章详表';

/*Data for the table `cms_article_data` */

insert  into `cms_article_data`(`id`,`content`,`copyfrom`,`relation`,`allow_comment`) values ('0e1b53dbd21442829c35b45592c94b37','<p class=\"MsoNormal\" style=\"text-indent:21.0pt;mso-char-indent-count:2.0;\r\nline-height:150%\">\r\n	<span style=\"font-family:宋体;mso-ascii-font-family:Calibri;\r\nmso-ascii-theme-font:minor-latin;mso-fareast-font-family:宋体;mso-fareast-theme-font:\r\nminor-fareast;mso-hansi-font-family:Calibri;mso-hansi-theme-font:minor-latin\">为了更好的服务于客户，组建了一支强大的技术团队为我们的客户服务，我们的原则是只要您是我们的客户，我们对于您的服务请求，一定会在第一时间给予回应。如有您有需要请按以下流程进行服务申请：</span></p>\r\n<p class=\"MsoListParagraph\" style=\"margin-left:18.0pt;text-indent:-18.0pt;\r\nmso-char-indent-count:0;line-height:150%;mso-list:l0 level1 lfo1\">\r\n	<span lang=\"EN-US\">1、<span style=\"font-variant-numeric: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp; </span></span><span style=\"font-family:宋体;mso-ascii-font-family:Calibri;mso-ascii-theme-font:minor-latin;\r\nmso-fareast-font-family:宋体;mso-fareast-theme-font:minor-fareast;mso-hansi-font-family:\r\nCalibri;mso-hansi-theme-font:minor-latin\">如果贵公司以向我们交了服务年费，请和你们的服务代表联系，如不知道服务代表电话，您可以通过以下两种方式来获得我们的帮助，一种是拨打公司服务热线</span><span lang=\"EN-US\">5551036</span><span style=\"font-family:宋体;mso-ascii-font-family:\r\nCalibri;mso-ascii-theme-font:minor-latin;mso-fareast-font-family:宋体;mso-fareast-theme-font:\r\nminor-fareast;mso-hansi-font-family:Calibri;mso-hansi-theme-font:minor-latin\">来进行咨询，第二种是通过微信平台提出服务预约。</span></p>\r\n<p class=\"MsoListParagraph\" style=\"margin-left:18.0pt;text-indent:-18.0pt;\r\nmso-char-indent-count:0;line-height:150%;mso-list:l0 level1 lfo1\">\r\n	<span lang=\"EN-US\">2、<span style=\"font-variant-numeric: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp; </span></span><span style=\"font-family:宋体;mso-ascii-font-family:Calibri;mso-ascii-theme-font:minor-latin;\r\nmso-fareast-font-family:宋体;mso-fareast-