y: block; margin: 10px auto;\" /></p>\r\n<p style=\"-webkit-tap-highlight-color: transparent; box-sizing: border-box; margin: 16px 0px; padding: 0px; color: rgb(34, 34, 34); font-family: -apple-system, helvetica, sans-serif; font-size: 16px; line-height: 28px; white-space: normal;\">\r\n	1722年11月13日，康熙皇帝病逝，四阿哥胤禛荣登大位，也结束了多年康熙诸子皇位之争，一切尘埃落定。</p>\r\n<p style=\"-webkit-tap-highlight-color: transparent; box-sizing: border-box; margin: 16px 0px; padding: 0px; color: rgb(34, 34, 34); font-family: -apple-system, helvetica, sans-serif; font-size: 16px; line-height: 28px; white-space: normal;\">\r\n	<img alt=\"康熙第16个儿子的一封奏折，还原了雍正近300年杀子之迷\" img_height=\"360\" img_width=\"600\" inline=\"0\" src=\"http://p1.pstatp.com/large/1dc60001fd6e749d3b22\" style=\"-webkit-tap-highlight-color: transparent; box-sizing: border-box; border-style: none; display: block; margin: 10px auto;\" /></p>\r\n<p style=\"-webkit-tap-highlight-color: transparent; box-sizing: border-box; margin: 16px 0px; padding: 0px; color: rgb(34, 34, 34); font-family: -apple-system, helvetica, sans-serif; font-size: 16px; line-height: 28px; white-space: normal;\">\r\n	<span style=\"-webkit-tap-highlight-color: transparent; box-sizing: border-box;\">雍正继位后，一方面按照自己思路治理国家，另一方面，为巩固皇权，开始打击那些与自己当年争位的兄弟，无论同母弟还是异母弟都在雍正的打击范围，这都在情理之中，否则雍正屁股没坐稳就会被篡位。</span></p>\r\n<p style=\"-webkit-tap-highlight-color: transparent; box-sizing: border-box; margin: 16px 0px; padding: 0px; color: rgb(34, 34, 34); font-family: -apple-system, helvetica, sans-serif; font-size: 16px; line-height: 28px; white-space: normal;\">\r\n	<img alt=\"康熙第16个儿子的一封奏折，还原了雍正近300年杀子之迷\" img_height=\"360\" img_width=\"600\" inline=\"0\" src=\"http://p9.pstatp.com/large/1f7f0001ea425bd2ed13\" style=\"-webkit-tap-highlight-color: transparent; box-sizing: border-box; border-style: none; display: block; margin: 10px auto;\" /></p>\r\n<p style=\"-webkit-tap-highlight-color: transparent; box-sizing: border-box; margin: 16px 0px; padding: 0px; color: rgb(34, 34, 34); font-family: -apple-system, helvetica, sans-serif; font-size: 16px; line-height: 28px; white-space: normal;\">\r\n	据有的史料记载，雍正不仅打击那些兄弟，而且对自己儿子也不留情。特别雍正的三儿子弘时，目睹了这场夺位之争，很同情那些叔叔们，本来有望接皇位，却被雍正给废了。有些史料记载，雍正把儿子杀死了。有的史料则认为弘时并不是雍正所杀。于是雍正杀子成为二百多年来人们争论不休的秘密。</p>\r\n<p style=\"-webkit-tap-highlight-color: transparent; box-sizing: border-box; margin: 16px 0px; padding: 0px; color: rgb(34, 34, 34); font-family: -apple-system, helvetica, sans-serif; font-size: 16px; line-height: 28px; white-space: normal;\">\r\n	首先看看，那些认为雍正杀子的人是怎么说的。</p>\r\n<p style=\"-webkit-tap-highlight-color: transparent; box-sizing: border-box; margin: 16px 0px; padding: 0px; color: rgb(34, 34, 34); font-family: -apple-system, helvetica, sans-serif; font-size: 16px; line-height: 28px; white-space: normal;\">\r\n	<img alt=\"康熙第16个儿子的一封奏折，还原了雍正近300年杀子之迷\" img_height=\"360\" img_width=\"600\" inline=\"0\" src=\"http://p9.pstatp.com/large/1f7e0001eba73d9f36f9\" style=\"-webkit-tap-highlight-color: transparent; box-sizing: border-box; border-style: none; display: block; margin: 10px auto;\" /></p>\r\n<p style=\"-webkit-tap-highlight-color: transparent; box-sizing: border-box; margin: 16px 0px; padding: 0px; color: rgb(34, 34, 34); font-family: -apple-system, helvetica, sans-serif; font-size: 16px; line-height: 28px; white-space: normal;\">\r\n	① 清史官唐邦治提出杀子说。唐邦治是清末的一位史官，1914年在清史馆工作时，他在《清皇室四谱》书中写道弘时少年放纵，行事不谨慎，后来被雍正赐死。这一提法对于后来人们猜测雍正杀子之说有了基础。必竟是清朝的史官，很多人认为他掌握第一手资料。</p>\r\n<p style=\"-webkit-tap-highlight-color: transparent; box-sizing: border-box; margin: 16px 0px; padding: 0px; color: rgb(34, 34, 34); font-family: -apple-system, helvetica, sans-serif; font-size: 16px; line-height: 28px; white-space: normal;\">\r\n	<img alt=\"康熙第16个儿子的一封奏折，还原了雍正近300年杀子之迷\" img_height=\"360\" img_width=\"600\" inline=\"0\" src=\"http://p1.pstatp.com/large/1f820004b0f1c149d43d\" style=\"-webkit-tap-highlight-color: transparent; box-sizing: border-box; border-style: none; display: block; margin: 10px auto;\" /></p>\r\n<p style=\"-webkit-tap-highlight-color: transparent; box-sizing: border-box; margin: 16px 0px; padding: 0px; color: rgb(34, 34, 34); font-family: -apple-system, helvetica, sans-serif; font-size: 16px; line-height: 28px; white-space: normal;\">\r\n	② 孟森的雍正杀子之说。孟森也是清末民初的一位史学家，他认为雍正皇帝在打压那些兄弟时，他的三儿子弘时与雍正意见相左，站在雍正的对立面，所以被雍正杀死。</p>\r\n<p style=\"-webkit-tap-highlight-color: transparent; box-sizing: border-box; margin: 16px 0px; padding: 0px; color: rgb(34, 34, 34); font-family: -apple-system, helvetica, sans-serif; font-size: 16px; line-height: 28px; white-space: normal;\">\r\n	③ 金承义还分析雍正杀子的原因，这就进一步证明了雍正杀子说</p>\r\n<p style=\"-webkit-tap-highlight-color: transparent; box-sizing: border-box; margin: 16px 0px; padding: 0px; color: rgb(34, 34, 34); font-family: -apple-system, helvetica, sans-serif; font-size: 16px; line-height: 28px; white-space: normal;\">\r\n	俗话说虎毒不食子，更何况人呢。不可否认历史上为了皇位，子杀父，兄杀弟的事。但就雍正来说，并没有可靠证据证明雍正杀子，都是靠着推理。必竟过去近三百年了，即使雍正杀子也应该留下证据。</p>\r\n<p style=\"-webkit-tap-highlight-color: transparent; box-sizing: border-box; margin: 16px 0px; padding: 0px; color: rgb(34, 34, 34); font-family: -apple-system, helvetica, sans-serif; font-size: 16px; line-height: 28px; white-space: normal;\">\r\n	<img alt=\"康熙第16个儿子的一封奏折，还原了雍正近300年杀子之迷\" img_height=\"360\" img_width=\"600\" inline=\"0\" src=\"http://p9.pstatp.com/large/1dc60001fdaf11df3f94\" style=\"-webkit-tap-highlight-color: transparent; box-sizing: border-box; border-style: none; display: block; margin: 10px auto;\" /></p>\r\n<p style=\"-webkit-tap-highlight-color: transparent; box-sizing: border-box; margin: 16px 0px; padding: 0px; color: rgb(34, 34, 34); font-family: -apple-system, helvetica, sans-serif; font-size: 16px; line-height: 28px; white-space: normal;\">\r\n	但从另一些史料记载看，却并没有说雍正杀死三子弘时。1735年，刚登上皇帝宝座的乾隆给了三哥弘时一个名份，也就是收回雍正当初剥夺弘时宗籍的旨意。但在对弘时评价上，还是以&ldquo;少年无知、性情放纵&rdquo;做了定性评价。</p>\r\n<p style=\"-webkit-tap-highlight-color: transparent; box-sizing: border-box; margin: 16px 0px; padding: 0px; color: rgb(34, 34, 34); font-family: -apple-system, helvetica, sans-serif; font-size: 16px; line-height: 28px; white-space: normal;\">\r\n	乾隆之所以为弘时平反，也说明弘时并没有做下不可饶恕的错误，如果是雍正所杀，乾隆刚当皇帝也不敢去平反。</p>\r\n<p style=\"-webkit-tap-highlight-color: transparent; box-sizing: border-box; margin: 16px 0px; padding: 0px; color: rgb(34, 34, 34); font-family: -apple-system, helvetica, sans-serif; font-size: 16px; line-height: 28px; white-space: normal;\">\r\n	<img alt=\"康熙第16个儿子的一封奏折，还原了雍正近300年杀子之迷\" img_height=\"360\" img_width=\"600\" inline=\"0\" src=\"http://p3.pstatp.com/large/1dc60001fe9f81f2497d\" style=\"-webkit-tap-highlight-color: transparent; box-sizing: border-box; border-style: none; display: block; margin: 10px auto;\" /></p>\r\n<p style=\"-webkit-tap-highlight-color: transparent; box-sizing: border-box; margin: 16px 0px; padding: 0px; color: rgb(34, 34, 34); font-family: -apple-system, helvetica, sans-serif; font-size: 16px; line-height: 28px; white-space: normal;\">\r\n	而让乾隆颁发旨意的是因为康熙第十六儿子允禄上的奏折。这些奏折说了四点：一是弘时因为同情允禩而获罪。二是弘时被雍正逐出皇宫，去给允禩当儿子。三是削掉皇籍由允祹看管。这些待遇比当时允禩后代强多了，也没说明弘时被雍正所杀的事。这说明雍正对亲儿子还是手下留情的。</p>',NULL,NULL,'1'),('4d51aa03ad7b4884885df4e3a4af3dc2','<p style=\"margin: 0px; padding: 0px; list-style: none; border: none; color: rgb(89, 87, 87); line-height: 26px; widows: 1; text-indent: 23.6pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">\r\n	<strong style=\"margin: 0px; padding: 0px;\"><span style=\"margin: 0px; padding: 0px; line-height: 2;\">又到年终岁尾， 我们财税人如何才能轻松渡过年关？资产负债何去何从？收入成本如何确认？本年度各税种缴纳是否正确？</span><span style=\"margin: 0px; padding: 0px; line-height: 2;\">&hellip;&hellip;</span><span style=\"margin: 0px; padding: 0px; line-height: 2;\">一系列的会计、税务问题困扰着我们财税人。鞍山金蝶公司为回馈金蝶会员，特举办这次财税培训，</span></strong><span style=\"margin: 0px; padding: 0px; line-height: 2;\">希望通过本次讲座，</span><strong style=\"margin: 0px; padding: 0px;\"><span style=\"margin: 0px; padding: 0px; line-he