sans-serif; font-size: 16px; line-height: 28px; white-space: normal;\">\r\n	库克称，早在2015年，中国就已经缩紧了围绕VPN的政策，要求相关运营者需取得政府所授予的牌照。</p>\r\n<p style=\"-webkit-tap-highlight-color: transparent; box-sizing: border-box; margin: 16px 0px; padding: 0px; color: rgb(34, 34, 34); font-family: -apple-system, helvetica, sans-serif; font-size: 16px; line-height: 28px; white-space: normal;\">\r\n	&ldquo;今年开始，中国增强了这一政策的执行力度。&rdquo;库克说，由于许多VPN应用并不满足监管者的规定，所以苹果被要求下架这些应用。</p>\r\n<p style=\"-webkit-tap-highlight-color: transparent; box-sizing: border-box; margin: 16px 0px; padding: 0px; color: rgb(34, 34, 34); font-family: -apple-system, helvetica, sans-serif; font-size: 16px; line-height: 28px; white-space: normal;\">\r\n	澎湃新闻此前报道，有关中国加强对不合规范的VPN清理整顿已经有一段时间。7月25日，针对&ldquo;个别中国境内的VPN供应商已经停止运作&rdquo;一事，工业和信息化部新闻发言人、总工程师张峰在当天的国新办例行发布会上表示，主要是对那些无证经营的、不符合规范的进行清理。对于依法依规的企业和个人是不受影响的。</p>\r\n<p style=\"-webkit-tap-highlight-color: transparent; box-sizing: border-box; margin: 16px 0px; padding: 0px; color: rgb(34, 34, 34); font-family: -apple-system, helvetica, sans-serif; font-size: 16px; line-height: 28px; white-space: normal;\">\r\n	&ldquo;我们宁愿不去移除这些应用，但就像是我们在任何一个国家和地区所做的那样，我们在遵守当地法律的情况下在当地开展生意。&rdquo;库克说。</p>\r\n<p style=\"-webkit-tap-highlight-color: transparent; box-sizing: border-box; margin: 16px 0px; padding: 0px; color: rgb(34, 34, 34); font-family: -apple-system, helvetica, sans-serif; font-size: 16px; line-height: 28px; white-space: normal;\">\r\n	尽管在中国地区移除了VPN应用，但库克仍然强调了苹果公司的立场：将为当地消费者提供最有趣的产品，并希望未来将放宽管制。&ldquo;我们相信，即使意见不同，但仍然可以与政府部门进行接洽并做生意。通过这一案例，我们期望在未来，一些管制将逐步放宽。&rdquo;库克说。</p>',NULL,NULL,'1'),('8','文章内容内容内容内容','来源','1,2,3','1'),('803a9f9659984815b91a99be3f076ce8','<p style=\"margin: 0px; padding: 0px; list-style: none; border: none; color: rgb(89, 87, 87);\">\r\n	&nbsp;</p>\r\n<p style=\"margin: 0px; padding: 0px; list-style: none; border: none; color: rgb(89, 87, 87);\">\r\n	<span style=\"margin: 0px; padding: 0px; line-height: 2; font-family: SimSun; font-size: 24px;\"><strong style=\"margin: 0px; padding: 0px;\">企业概况</strong></span></p>\r\n<p style=\"margin: 0px; padding: 0px; list-style: none; border: none; color: rgb(89, 87, 87);\">\r\n	&nbsp;</p>\r\n<p style=\"margin: 0px; padding: 0px; list-style: none; border: none; color: rgb(89, 87, 87);\">\r\n	<span style=\"margin: 0px; padding: 0px; line-height: 2; font-family: SimSun; font-size: 18px;\">&nbsp; &nbsp;紫竹桩基础工程股份有限公司成立于2011年，主要业务包括各类钢板桩的销售、租赁、设计、施工、防腐，以及其它各类钢结构制作。现有产品包括U型、Z型、板型等几大系列三十余个规格的钢板桩产品，ф400mm-ф2000mm的钢管桩产品，产品质量达到国际领先水平。公司下设上海子公司、天津子公司、鞍山子公司、哈尔滨子公司、广州子公司、北京 办事处、福州办事处、武汉办事处、成都办事处等十余个分支机构，经营网络覆盖全国。公司拥有先进的打桩及配套施工设备，优秀的专业技术人员，以及专门的施 工设计和防腐设计团队，可面向国内国外承揽房屋建筑基坑支护、驳岸码头支护、挡土止水帷幕墙、防波堤导流堤护岸、桥墩止水围堰、临时筑岛，管沟支护及各类市政基坑支护等中大型工程项目的施工。</span></p>\r\n<p style=\"margin: 0px; padding: 0px; list-style: none; border: none; color: rgb(89, 87, 87);\">\r\n	&nbsp;</p>\r\n<p style=\"margin: 0px; padding: 0px; list-style: none; border: none; color: rgb(89, 87, 87);\">\r\n	<span style=\"margin: 0px; padding: 0px; line-height: 2; font-family: SimSun; font-size: 18px;\"><span style=\"margin: 0px; padding: 0px; font-size: 24px;\"><strong style=\"margin: 0px; padding: 0px;\">发展的&ldquo;瓶颈</strong></span>&rdquo;</span></p>\r\n<p style=\"margin: 0px; padding: 0px; list-style: none; border: none; color: rgb(89, 87, 87);\">\r\n	&nbsp;</p>\r\n<div style=\"margin: 0px; padding: 0px; color: rgb(89, 87, 87);\">\r\n	<span style=\"margin: 0px; padding: 0px; line-height: 2; font-family: SimSun; font-size: 18px;\">&nbsp; &nbsp;标准财务软件应用模式不能满足企业管理要求</span></div>\r\n<div style=\"margin: 0px; padding: 0px; color: rgb(89, 87, 87);\">\r\n	<span style=\"margin: 0px; padding: 0px; line-height: 2; font-family: SimSun; font-size: 18px;\">&nbsp; &nbsp;业务流程手工进行单据流转不能满足企业快速发展的业务需求，在现在的信息化时代仍在用电话、传真、邮寄等手工模式进行业务流程流转，可能会造成数据延迟、信息传递错误、后补签字、不能及时清晰各地库存信息等，已不能满足企业快速发展的业务需求，信息化已迫在眉睫。</span></div>\r\n<p style=\"margin: 0px; padding: 0px; list-style: none; border: none; color: rgb(89, 87, 87);\">\r\n	<span style=\"margin: 0px; padding: 0px; line-height: 2; font-family: SimSun; font-size: 18px;\">&nbsp; &nbsp;手工进行仓库管理，各分公司、总公司等式库存信息不能共享。总部、各分公司仓库均手工进行记录，每天报报表到总部，但信息不能及时共享，出入库数据量大时手工报的信息准确性也有待商榷。 &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</span><span style=\"margin: 0px; padding: 0px; line-height: 2; font-family: SimSun; font-size: 18px;\">整体管理缺少信息化数据支撑。</span></p>\r\n<p style=\"margin: 0px; padding: 0px; list-style: none; border: none; color: rgb(89, 87, 87);\">\r\n	&nbsp;</p>\r\n<p style=\"margin: 0px; padding: 0px; list-style: none; border: none; color: rgb(89, 87, 87);\">\r\n	<span style=\"margin: 0px; padding: 0px; line-height: 2; font-family: SimSun; font-size: 18px;\"><span style=\"margin: 0px; padding: 0px; font-size: 24px;\"><strong style=\"margin: 0px; padding: 0px;\">金蝶助&ldquo;紫竹桩基&rdquo;腾飞&nbsp;</strong></span></span></p>\r\n<p style=\"margin: 0px; padding: 0px; list-style: none; border: none; color: rgb(89, 87, 87);\">\r\n	<span style=\"margin: 0px; padding: 0px; line-height: 2; font-family: SimSun; font-size: 18px;\"><span style=\"margin: 0px; padding: 0px; font-size: 24px;\"><strong style=\"margin: 0px; padding: 0px;\">&nbsp;</strong></span>&nbsp;&nbsp;&nbsp;</span></p>\r\n<div style=\"margin: 0px; padding: 0px; color: rgb(89, 87, 87);\">\r\n	<span style=\"margin: 0px; padding: 0px; line-height: 2; font-family: SimSun; font-size: 18px;\">&nbsp; &nbsp;从财务核算方面属租赁、工程设计、工程施工行业，以一个合同为成本中心进行核算成本收入；实现了以多种多样的日租金计算模式来进行收入的统计，在BOS基础上开发的软件满足了企业多种多样的租金计算模式</span></div>\r\n<div style=\"margin: 0px; padding: 0px; color: rgb(89, 87, 87);\">\r\n	<span style=\"margin: 0px; padding: 0px; line-height: 2; font-family: SimSun; font-size: 18px;\">&nbsp; &nbsp;所有的审批单据均在线上流转，审批流程及时严谨，满足了企业快速发展的业务需求。</span></div>\r\n<div style=\"margin: 0px; padding: 0px; color: rgb(89, 87, 87);\">\r\n	<span style=\"margin: 0px; padding: 0px; line-height: 2; font-family: SimSun; font-size: 18px;\">&nbsp; &nbsp;采用远程应用技术，使各地的子公司都能同时进入金蝶系统，将各子公司的库存数据和业务数据都录入到金蝶系统, 所有的数据和信息都可以及时共享，便于统计和分析。</span></div>\r\n<div style=\"margin: 0px; padding: 0px; color: rgb(89, 87, 87);\">\r\n	<span style=\"margin: 0px; padding: 0px; line-height: 2; font-family: SimSun; font-size: 18px;\">&nbsp; &nbsp;大量个性而丰富的报表满足了企业对数据的统计和分析，为企业做出正确决策提供了强有力的数据支撑。</span></div>\r\n<div style=\"margin: 0px; padding: 0px; color: rgb(89, 87, 87);\">\r\n	&nbsp;</div>',NULL,NULL,'1'),('86383321e94f499fbf422884097b19e4','<div>\r\n	ZT软件公司成立于1998年，是一家专业从事ERP咨询服务的供应商，经过十几年的经营和发展，已成为鞍山历史最悠久、经验最丰富的企业信息化服务商。 鞍山金蝶公司从成立之初就以&ldquo;以人为本，技术领先&rdquo;为宗旨，注重人才的引进，强化公司员工能力的提升，通过培训不断的壮大自己。通过多年不懈努力，鞍山金蝶公司已经拥有了一批在鞍山地区目前最年轻、最有敬业精神、最具专业水平的实施服务团队，能够为您提供最完善的企业信息化解决方案和即时响应服务：真诚的为您解除企业管理软件应用中的烦恼。 我们的口号是&ldquo;要做鞍山最专业的企业管理软件实施服务厂商&rdquo;。十几年的管理软件实践历程，我们在电子、机械、房地产、饲料、矿山等行业积累了丰富的经验，潜心研发了能适应各种应用环境的智能矿山物流系统以及饲料行业管理系统等多个软件产品，有效的引领了企业管理创新的方向。 我们始终秉承&ldquo;用心服务，点燃生命&rdquo;核心价值观，洞察软件领域的新科技、新方法，极尽全力为客户提供卓有成效的价值服务，实现企业、员工、客户的共同发展，成就智慧企业，实现民族梦想，努力成为一流的应用软件解决方案供应商。\r\n	<div>\r\n		&nbsp;</div>\r\n</div>\r\n<p>\r\n	&nbsp;</p>',NULL,NULL,'1'),('9','文章内容内容内容内容','来源','1,2,3','1'),('960fb54e6f624afab7a671d92362368d','<p>\r\n	公司介绍公司介绍公司介绍公司介绍公司介绍公司介绍</p>',NULL,NULL,'1'),('975a184948074ccf920461a1f303a067','',NULL,NULL,'1'),('99ae757e0d154d5980992b51f5ccb55b','',NULL,NULL,'1'),('9bcdb92e5d634d99a05181a12332e73c','<p style=\"-webkit-tap-highlight-color: transparent; box-sizing: border-box; margin: 0px 0px 20px; padding: 0px; line-height: 28px; color: rgb(101, 113, 128); font-family: \'PingFang SC\', \'Hiragino Sans GB\', \'Microsoft YaHei\', \'WenQuanYi Micro Hei\', \'Helvetica Neue\', Arial, sans-serif; font-size: 16px; white-space: normal;\">\r\n	终于，这个惨淡的暑期档，有爆款救市了。吴京和他的《战狼2》，上映6日，斩获超过13亿票房，以此势头，15亿无忧，20亿可期。</p>\r\n<p style=\"-webkit-tap-highlight-color: transparent; box-sizing: border-box; margin: 0px 0px 20px; padding: 0px; line-height: 28px; color: rgb(101, 113, 128); font-family: \'PingFang SC\', \'Hiragino Sans GB\', \'Microsoft YaHei\', \'WenQuanYi Micro Hei\', \'Helvetica Neue\', Arial, sans-serif; font-size: 16px; white-space: normal;\">\r\n	<img img_height=\"373\" img_width=\"592\" src=\"http://p3.pstatp.com/large/2c63001d7631b21adc0d\" style=\"-webkit-tap-highlight-color: transparent; box-sizing: border-box; border-style: none; display: block; margin-bottom: 10px; margin-top: 10px;\" /></p>\r\n<p style=\"-webkit-tap-highlight-color: transparent; box-sizing: border-box; margin: 0px 0px 20px; padding: 0px; line-height: 28px; color: rgb(101, 113, 128); font-family: \'PingFang SC\', \'Hiragino Sans GB\', \'Microsoft YaHei\', \'WenQuanYi Micro Hei\', \'Helvetica Neue\', Arial, sans-serif; font-size: 16px; white-space: normal;\">\r\n	可是，当初这部电影不被看好没什么人投资，吴京还把自己的别墅抵押了出去，筹到了8000万。因为没人愿意拍，吴京不得不身兼数职：导演、编剧、演员、出品人。曾经定好的女主角拍摄前临时要求加片酬，无奈之下更换女主&hellip;&hellip;</p>\r\n<p style=\"-webkit-tap-highlight-color: transparent; box-sizing: border-box; margin: 0px 0px 20px; padding: 0px; line-height: 28px; color: rgb(101, 113, 128); font-family: \'PingFang SC\', \'Hiragino Sans GB\', \'Microsoft YaHei\', \'WenQuanYi Micro Hei\', \'Helvetica Neue\', Arial, sans-serif; font-size: 16px; white-space: normal;\">\r\n	还好全力的付出得到了回报，赢得了口碑人气和票房。</p>\r\n<p style=\"-webkit-tap-highlight-color: transparent; box-sizing: border-box; margin: 0px 0px 20px; padding: 0px; line-height: 28px; color: rgb(101, 113, 128); font-family: \'PingFang SC\', \'Hiragino Sans GB\', \'Microsoft YaHei\', \'WenQuanYi Micro Hei\', \'Helvetica Neue\', Arial, sans-serif; font-size: 16px; white-space: normal;\">\r\n	拿出家底的吴京能赚多少？</p>\r\n<p style=\"-webkit-tap-highlight-color: transparent; box-sizing: border-box; margin: 0px 0px 20px; padding: 0px; line-height: 28px; color: rgb(101, 113, 128); font-family: \'PingFang SC\', \'Hiragino Sans GB\', \'Microsoft YaHei\', \'WenQuanYi Micro Hei\', \'Helvetica Neue\', Arial, sans-serif; font-size: 16px; white-space: normal;\">\r\n	在国内，一部电影的总票房中，扣除固定的3.3%的营业税和5%电影发展基金，剩余的票房进账中，制作方和院线的票房分成一般是4：6，也就是说如果一部影片的票房是1亿的话，制作方拿4000万，电影院拿6000万。这个比例会有小幅的变化，但一般都是只低不高。</p>\r\n<p style=\"-webkit-tap-highlight-color: transparent; box-sizing: border-box; margin: 0px 0px 20px; padding: 0px; line-height: 28px; color: rgb(101, 113, 128); font-family: \'PingFang SC\', \'Hiragino Sans GB\', \'Microsoft YaHei\', \'WenQuanYi Micro Hei\', \'Helvetica Neue\', Arial, sans-serif; font-size: 16px; white-space: normal;\">\r\n	以《战狼2》来说，制作方吴京团队和投资方能拿到43%的票房分成。根据吴京所说，《战狼2》的制作成本为2亿，也就是说，票房达到6.6亿左右时才能回本。很显然吴京做到了。</p>\r\n<p style=\"-webkit-tap-highlight-color: transparent; box-sizing: border-box; margin: 0px 0px 20px; padding: 0px; line-height: 28px; color: rgb(101, 113, 128); font-family: \'PingFang SC\', \'Hiragino Sans GB\', \'Microsoft YaHei\', \'WenQuanYi Micro Hei\', \'Helvetica Neue\', Arial, sans-serif; font-size: 16px; white-space: normal;\">\r\n	<img img_height=\"385\" img_width=\"640\" src=\"http://p1.pstatp.com/large/2c6b001d8a543357e094\" style=\"-webkit-tap-highlight-color: transparent; box-sizing: border-box; border-style: none; display: block; margin-bottom: 10px; margin-top: 10px;\" /></p>\r\n<p style=\"-webkit-tap-highlight-color: transparent; box-sizing: border-box; margin: 0px 0px 20px; padding: 0px; line-height: 28px; color: rgb(101, 113, 128); font-family: \'PingFang SC\', \'Hiragino Sans GB\', \'Microsoft YaHei\', \'WenQuanYi Micro Hei\', \'Helvetica Neue\', Arial, sans-serif; font-size: 16px; white-space: normal;\">\r\n	保底8亿，吴京得2 .17亿；若破20亿，吴京入账4亿元</p>\r\n<p style=\"-webkit-tap-highlight-color: transparent; box-sizing: border-box; margin: 0px 0px 20px; padding: 0px; line-height: 28px; color: rgb(101, 113, 128); font-family: \'PingFang SC\', \'Hiragino Sans GB\', \'Microsoft YaHei\', \'WenQuanYi Micro Hei\', \'Helvetica Neue\', Arial, sans-serif; font-size: 16px; white-space: normal;\">\r\n	对于这部的各家出品方和吴京本人来说，《战狼2》首周末就已经完成保底发行的&ldquo;大业&rdquo;。</p>\r\n<p style=\"-webkit-tap-highlight-color: transparent; box-sizing: border-box; margin: 0px 0px 20px; padding: 0px; line-height: 28px; color: rgb(101, 113, 128); font-family: \'PingFang SC\', \'Hiragino Sans GB\', \'Microsoft YaHei\', \'WenQuanYi Micro Hei\', \'Helvetica Neue\', Arial, sans-serif; font-size: 16px; white-space: normal;\">\r\n	2016年8月，早在《战狼2》还未制作完成时，北京文化和聚合影联两家公司联合宣布保底吴京的这部话题新作，保底价格为8亿元。按照彼时公布的保底发行协议，《战狼2》主要出品方，也即吴京旗下的登峰国际，将获得不少于2.17亿的收益。若《战狼2》最终票房突破20亿元，吴京代表的出品方很可能有接近4亿元入账。</p>\r\n<p style=\"-webkit-tap-highlight-color: transparent; box-sizing: border-box; margin: 0px 0px 20px; padding: 0px; line-height: 28px; color: rgb(101, 113, 128); font-family: \'PingFang SC\', \'Hiragino Sans GB\', \'Microsoft YaHei\', \'WenQuanYi Micro Hei\', \'Helvetica Neue\', Arial, sans-serif; font-size: 16px; white-space: normal;\">\r\n	即便如吴京所说，《战狼2》制作费高达1.5亿-2亿，按照如今票房走势，吴京依旧大赚。别墅还能继续住，钱还翻倍地赚，小编觉得这是吴京应得的，应了那句&ldquo;天道酬勤，实至名归&rdquo;。</p>\r\n<p style=\"-webkit-tap-highlight-color: transparent; box-sizing: border-box; margin: 0px 0px 20px; padding: 0px; line-height: 28px; color: rgb(101, 113, 128); font-family: \'PingFang SC\', \'Hiragino Sans GB\', \'Microsoft YaHei\', \'WenQuanYi Micro Hei\', \'Helvetica Neue\', Arial, sans-serif; font-size: 16px; white-space: normal;\">\r\n	<img img_height=\"417\" img_width=\"640\" src=\"http://p3.pstatp.com/large/2c65001e86e1adaa6e57\" style=\"-webkit-tap-highlight-color: transparent; box-sizing: border-box; border-style: none; display: block; margin-bottom: 10px; margin-top: 10px;\" /></p>\r\n<p style=\"-webkit-tap-highlight-color: transparent; box-sizing: border-box; margin: 0px 0px 20px; padding: 0px; line-height: 28px; color: rgb(101, 113, 128); font-family: \'PingFang SC\', \'Hiragino Sans GB\', \'Microsoft YaHei\', \'WenQuanYi Micro Hei\', \'Helvetica Neue\', Arial, sans-serif; font-size: 16px; white-space: normal;\">\r\n	保底公司这次押对了宝！</p>\r\n<p style=\"-webkit-tap-highlight-color: transparent; box-sizing: border-box; margin: 0px 0px 20px; padding: 0px; line-height: 28px; color: rgb(101, 113, 128); font-family: \'PingFang SC\', \'Hiragino Sans GB\', \'Microsoft YaHei\', \'WenQuanYi Micro Hei\', \'Helvetica Neue\', Arial, sans-serif; font-size: 16px; white-space: normal;\">\r\n	《战狼2》如此彪悍的战绩，更高兴的应是两家保底公司，当真押对了宝。</p>\r\n<p style=\"-webkit-tap-highlight-color: transparent; box-sizing: border-box; margin: 0px 0px 20px; padding: 0px; line-height: 28px; color: rgb(101, 113, 128); font-family: \'PingFang SC\', \'Hiragino Sans GB\', \'Microsoft YaHei\', \'WenQuanYi Micro Hei\', \'Helvetica Neue\', Arial, sans-serif; font-size: 16px; white-space: normal;\">\r\n	数据显示，自《战狼2》7月27日上映以来，北京文化股价自13.54元/股上涨至昨日收盘时的16.5元/股。按照公司7.26亿总股本计算，市值增长逾20亿元，而公司目前总市值达120亿元。</p>\r\n<p style=\"-webkit-tap-highlight-color: transparent; box-sizing: border-box; margin: 0px 0px 20px; padding: 0px; line-height: 28px; color: rgb(101, 113, 128); font-family: \'PingFang SC\', \'Hiragino Sans GB\', \'Microsoft YaHei\', \'WenQuanYi Micro Hei\', \'Helvetica Neue\', Arial, sans-serif; font-size: 16px; white-space: normal;\">\r\n	<img img_height=\"823\" img_width=\"640\" src=\"http://p3.pstatp.com/large/2c6b001d8a55fbc7c740\" style=\"-webkit-tap-highlight-color: transparent; box-sizing: border-box; border-style: none; display: block; margin-bottom: 10px; margin-top: 10px;\" /></p>\r\n<p style=\"-webkit-tap-highlight-color: transparent; box-sizing: border-box; margin: 0px 0px 20px; padding: 0px; line-height: 28px; color: rgb(101, 113, 128); font-family: \'PingFang SC\', \'Hiragino Sans GB\', \'Microsoft YaHei\', \'WenQuanYi Micro Hei\', \'Helvetica Neue\', Arial, sans-serif; font-size: 16px; white-space: normal;\">\r\n	昨日晚间，北京文化发布公告披露《战狼2》累计票房情况。公司董秘陈晨在接受中国证券报采访时表示：&ldquo;《战狼2》2亿多的总投资中，我们只投了500多万。保底发行的投入为1.4亿元。若票房达到20亿元，公司投资的净利润将达到7000-8000万元。&rdquo;</p>',NULL,NULL,'1'),('aea43bddef4240d1a8a717f6fae9b826','<p>\r\n	测试测试测试测试测试测试测试测试测试测试测试测试测试测试测试测试测试测试测试测试测试测试测试测试测试测试测试</p>',NULL,NULL,'1'),('b695f0e5a52e4e8d814896f594bd78b9','<p class=\"MsoNormal\" style=\"text-align: center;\">\r\n	&nbsp;</p>\r\n<p class=\"MsoNormal\">\r\n	<span style=\"font-size:18px;\"><span style=\"font-family: 黑体;\">名头：百度科技有限公司</span></span><span style=\"font-size:18.0pt;font-family:黑体;mso