ace: normal;\">\r\n	康熙皇帝一生有过六次南巡，其中三次经过孔子的故乡曲阜。在我国历史上，孔子一直被尊为圣人，他的家乡也被视为文化圣地，不管是谁经过，都会进行祭拜，康熙也不例外。但康熙在拜孔子墓的时候却出现了一件有趣的事情，他先是死活不肯下跪，直到一大臣挡住墓碑上一个字后，才扑通一声跪下了，这是怎么回事呢？</p>\r\n<p style=\"-webkit-tap-highlight-color: transparent; box-sizing: border-box; margin: 16px 0px; padding: 0px; color: rgb(34, 34, 34); font-family: -apple-system, helvetica, sans-serif; font-size: 16px; line-height: 28px; white-space: normal;\">\r\n	<img alt=\"康熙拜孔子时死活不肯下跪，一大臣挡住墓碑上一个字后，他扑通一声跪下了\" img_height=\"291\" img_width=\"405\" inline=\"0\" src=\"http://p3.pstatp.com/large/31e000015b67ed02fb61\" style=\"-webkit-tap-highlight-color: transparent; box-sizing: border-box; border-style: none; display: block; margin: 10px auto;\" /></p>\r\n<p style=\"-webkit-tap-highlight-color: transparent; box-sizing: border-box; margin: 16px 0px; padding: 0px; color: rgb(34, 34, 34); font-family: -apple-system, helvetica, sans-serif; font-size: 16px; line-height: 28px; white-space: normal;\">\r\n	康熙最开始是在孔庙祭拜孔子，他破天荒的对着孔子的圣象行了三跪九叩的大礼，行完大礼后又亲自诵读祭文，将在场的文武百官和士大夫们感动得一塌糊涂，直呼万岁。祭拜完后，康熙出了孔庙，来到孔林，准备在孔墓面前进行第二次祭拜。</p>\r\n<p style=\"-webkit-tap-highlight-color: transparent; box-sizing: border-box; margin: 16px 0px; padding: 0px; color: rgb(34, 34, 34); font-family: -apple-system, helvetica, sans-serif; font-size: 16px; line-height: 28px; white-space: normal;\">\r\n	<img alt=\"康熙拜孔子时死活不肯下跪，一大臣挡住墓碑上一个字后，他扑通一声跪下了\" img_height=\"333\" img_width=\"500\" inline=\"0\" src=\"http://p1.pstatp.com/large/31e000015ea172073bda\" style=\"-webkit-tap-highlight-color: transparent; box-sizing: border-box; border-style: none; display: block; margin: 10px auto;\" /></p>\r\n<p style=\"-webkit-tap-highlight-color: transparent; box-sizing: border-box; margin: 16px 0px; padding: 0px; color: rgb(34, 34, 34); font-family: -apple-system, helvetica, sans-serif; font-size: 16px; line-height: 28px; white-space: normal;\">\r\n	不出意外的话，这次祭拜康熙同样会行三跪九叩的大礼。但大臣们却发现，康熙站在墓前，眼睛一直盯着墓碑上的字，却迟迟没有任何动作。这时他的贴身太监上前询问，康熙这才转过身来，看着众人，一脸为难的表情，想要说什么但是又没有说，让场面非常尴尬。</p>\r\n<p style=\"-webkit-tap-highlight-color: transparent; box-sizing: border-box; margin: 16px 0px; padding: 0px; color: rgb(34, 34, 34); font-family: -apple-system, helvetica, sans-serif; font-size: 16px; line-height: 28px; white-space: normal;\">\r\n	<img alt=\"康熙拜孔子时死活不肯下跪，一大臣挡住墓碑上一个字后，他扑通一声跪下了\" img_height=\"255\" img_width=\"400\" inline=\"0\" src=\"http://p3.pstatp.com/large/31e70002033dd5d4e765\" style=\"-webkit-tap-highlight-color: transparent; box-sizing: border-box; border-style: none; display: block; margin: 10px auto;\" /></p>\r\n<p style=\"-webkit-tap-highlight-color: transparent; box-sizing: border-box; margin: 16px 0px; padding: 0px; color: rgb(34, 34, 34); font-family: -apple-system, helvetica, sans-serif; font-size: 16px; line-height: 28px; white-space: normal;\">\r\n	这时一个心细的大臣看出了康熙的心思，他先是上前将康熙引到一旁休息，然后找来一块黄布，盖住了墓碑上的一个字。当康熙回来后，看到字被盖住了，立即下跪行了叩头大礼。这件事情让在场的人大为不解，但众人又不敢去问康熙，因此纷纷请教那位大臣。</p>\r\n<p style=\"-webkit-tap-highlight-color: transparent; box-sizing: border-box; margin: 16px 0px; padding: 0px; color: rgb(34, 34, 34); font-family: -apple-system, helvetica, sans-serif; font-size: 16px; line-height: 28px; white-space: normal;\">\r\n	<img alt=\"康熙拜孔子时死活不肯下跪，一大臣挡住墓碑上一个字后，他扑通一声跪下了\" img_height=\"300\" img_width=\"402\" inline=\"0\" src=\"http://p1.pstatp.com/large/31d300051b533995655b\" style=\"-webkit-tap-highlight-color: transparent; box-sizing: border-box; border-style: none; display: block; margin: 10px auto;\" /></p>\r\n<p style=\"-webkit-tap-highlight-color: transparent; box-sizing: border-box; margin: 16px 0px; padding: 0px; color: rgb(34, 34, 34); font-family: -apple-system, helvetica, sans-serif; font-size: 16px; line-height: 28px; white-space: normal;\">\r\n	原来，孔子的墓碑上刻了&ldquo;大成至圣文宣王&rdquo;几个大字，康熙贵为九五之尊，当然不能向王下跪。在他心里，孔子是圣贤，是老师，但不是王。所以，当他回来后，看到王字被盖住了，便立刻恭敬的叩拜了孔子，再没有半点迟疑！</p>',NULL,NULL,'1'),('c5abd8b886bc4a8f8af5d95ba2b012db','<p>\r\n	客户通知客户通知客户通知客户通知客户通知客户通知客户通知客户通知客户通知客户通知客户通知客户通知客户通知客户通知客户通知客户通知客户通知客户通知客户通知客户通知客户通知客户通知客户通知客户通知客户通知客户通知客户通知客户通知客户通知客户通知</p