n></span></p>\r\n<p class=\"MsoNormal\">\r\n	<span style=\"font-size:18px;\"><span style=\"font-family: 黑体;\">帐号：<span lang=\"EN-US\">7200000005088888</span></span></span><span style=\"font-size:18.0pt;font-family:黑体;mso-hansi-font-family:\r\n&quot;Times New Roman&quot;\"><span lang=\"EN-US\"><o:p></o:p></span></span></p>\r\n<p class=\"MsoNormal\">\r\n	<span style=\"font-size:18px;\"><span style=\"font-family: 黑体;\">税号：<span lang=\"EN-US\">912103003538888888</span></span></span><span style=\"font-size:18.0pt;font-family:黑体;mso-hansi-font-family:\r\n&quot;Times New Roman&quot;\"><span lang=\"EN-US\"><o:p></o:p></span></span></p>',NULL,NULL,'1'),('e61dbf77261543d588646d01c057defc','<p style=\"margin: 0px; padding: 0px; list-style: none; border: none; color: rgb(89, 87, 87); line-height: 26px; widows: 1;\">\r\n	<strong style=\"font-family: SimSun; font-size: 24px; line-height: 2; margin: 0px; padding: 0px;\">企业概况</strong></p>\r\n<p style=\"margin: 0px; padding: 0px; list-style: none; border: none; color: rgb(89, 87, 87); line-height: 26px; widows: 1;\">\r\n	&nbsp;</p>\r\n<p style=\"margin: 0px; padding: 0px; list-style: none; border: none; color: rgb(89, 87, 87); line-height: 26px; widows: 1;\">\r\n	<span style=\"margin: 0px; padding: 0px; line-height: 2; font-family: SimSun; font-size: 18px;\">&nbsp; &nbsp;紫竹桩基础工程股份有限公司成立于2011年，主要业务包括各类钢板桩的销售、租赁、设计、施工、防腐，以及其它各类钢结构制作。现有产品包括U型、Z型、板型等几大系列三十余个规格的钢板桩产品，ф400mm-ф2000mm的钢管桩产品，产品质量达到国际领先水平。公司下设上海子公司、天津子公司、鞍山子公司、哈尔滨子公司、广州子公司、北京 办事处、福州办事处、武汉办事处、成都办事处等十余个分支机构，经营网络覆盖全国。公司拥有先进的打桩及配套施工设备，优秀的专业技术人员，以及专门的施 工设计和防腐设计团队，可面向国内国外承揽房屋建筑基坑支护、驳岸码头支护、挡土止水帷幕墙、防波堤导流堤护岸、桥墩止水围堰、临时筑岛，管沟支护及各类市政基坑支护等中大型工程项目的施工。</span></p>\r\n<p style=\"margin: 0px; padding: 0px; list-style: none; border: none; color: rgb(89, 87, 87); line-height: 26px; widows: 1;\">\r\n	&nbsp;</p>\r\n<p style=\"margin: 0px; padding: 0px; list-style: none; border: none; color: rgb(89, 87, 87); line-height: 26px; widows: 1;\">\r\n	<span style=\"margin: 0px; padding: 0px; line-height: 2; font-family: SimSun; font-size: 18px;\"><span style=\"margin: 0px; padding: 0px; font-size: 24px;\"><strong style=\"margin: 0px; padding: 0px;\">发展的&ldquo;瓶颈</strong></span>&rdquo;</span></p>\r\n<p style=\"margin: 0px; padding: 0px; list-style: none; border: none; color: rgb(89, 87, 87); line-height: 26px; widows: 1;\">\r\n	&nbsp;</p>\r\n<div style=\"margin: 0px; padding: 0px; color: rgb(89, 87, 87); line-height: 26px; widows: 1;\">\r\n	<span style=\"margin: 0px; padding: 0px; line-height: 2; font-family: SimSun; font-size: 18px;\">&nbsp; &nbsp;标准财务软件应用模式不能满足企业管理要求</span></div>\r\n<div style=\"margin: 0px; padding: 0px; color: rgb(89, 87, 87); line-height: 26px; widows: 1;\">\r\n	<span style=\"margin: 0px; padding: 0px; line-height: 2; font-family: SimSun; font-size: 18px;\">&nbsp; &nbsp;业务流程手工进行单据流转不能满足企业快速发展的业务需求，在现在的信息化时代仍在用电话、传真、邮寄等手工模式进行业务流程流转，可能会造成数据延迟、信息传递错误、后补签字、不能及时清晰各地库存信息等，已不能满足企业快速发展的业务需求，信息化已迫在眉睫。</span></div>\r\n<p style=\"margin: 0px; padding: 0px; list-style: none; border: none; color: rgb(89, 87, 87); line-height: 26px; widows: 1;\">\r\n	<span style=\"margin: 0px; padding: 0px; line-height: 2; font-family: SimSun; font-size: 18px;\">&nbsp; &nbsp;手工进行仓库管理，各分公司、总公司等式库存信息不能共享。总部、各分公司仓库均手工进行记录，每天报报表到总部，但信息不能及时共享，出入库数据量大时手工报的信息准确性也有待商榷。 &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</span><span style=\"margin: 0px; padding: 0px; line-height: 2; font-family: SimSun; font-size: 18px;\">整体管理缺少信息化数据支撑。</span></p>\r\n<p style=\"margin: 0px; padding: 0px; list-style: none; border: none; color: rgb(89, 87, 87); line-height: 26px; widows: 1;\">\r\n	&nbsp;</p>\r\n<p style=\"margin: 0px; padding: 0px; list-style: none; border: none; color: rgb(89, 87, 87); line-height: 26px; widows: 1;\">\r\n	<span style=\"margin: 0px; padding: 0px; line-height: 2; font-family: SimSun; font-size: 18px;\"><span style=\"margin: 0px; padding: 0px; font-size: 24px;\"><strong style=\"margin: 0px; padding: 0px;\">金蝶助&ldquo;紫竹桩基&rdquo;腾飞&nbsp;</strong></span></span></p>\r\n<p style=\"margin: 0px; padding: 0px; list-style: none; border: none; color: rgb(89, 87, 87); line-height: 26px; widows: 1;\">\r\n	<span style=\"margin: 0px; padding: 0px; line-height: 2; font-family: SimSun; font-size: 18px;\"><span style=\"margin: 0px; padding: 0px; font-size: 24px;\"><strong style=\"margin: 0px; padding: 0px;\">&nbsp;</strong></span>&nbsp;&nbsp;&nbsp;</span></p>\r\n<div style=\"margin: 0px; padding: 0px; color: rgb(89, 87, 87); line-height: 26px; widows: 1;\">\r\n	<span style=\"margin: 0px; padding: 0px; line-height: 2; font-family: SimSun; font-size: 18px;\">&nbsp; &nbsp;从财务核算方面属租赁、工程设计、工程施工行业，以一个合同为成本中心进行核算成本收入；实现了以多种多样的日租金计算模式来进行收入的统计，在BOS基础上开发的软件满足了企业多种多样的租金计算模式</span></div>\r\n<div style=\"margin: 0px; padding: 0px; color: rgb(89, 87, 87); line-height: 26px; widows: 1;\">\r\n	<span style=\"margin: 0px; padding: 0px; line-height: 2; font-family: SimSun; font-size: 18px;\">&nbsp; &nbsp;所有的审批单据均在线上流转，审批流程及时严谨，满足了企业快速发展的业务需求。</span></div>\r\n<div style=\"margin: 0px; padding: 0px; color: rgb(89, 87, 87); line-height: 26px; widows: 1;\">\r\n	<span style=\"margin: 0px; padding: 0px; line-height: 2; font-family: SimSun; font-size: 18px;\">&nbsp; &nbsp;采用远程应用技术，使各地的子公司都能同时进入金蝶系统，将各子公司的库存数据和业务数据都录入到金蝶系统, 所有的数据和信息都可以及时共享，便于统计和分析。</span></div>\r\n<div style=\"margin: 0px; padding: 0px; color: rgb(89, 87, 87); line-height: 26px; widows: 1;\">\r\n	<span style=\"margin: 0px; padding: 0px; line-height: 2; font-family: SimSun; font-size: 18px;\">&nbsp; &nbsp;大量个性而丰富的报表满足了企业对数据的统计和分析，为企业做出正确决策提供了强有力的数据支撑。</span></div>\r\n<div style=\"margin: 0px; padding: 0px; color: rgb(89, 87, 87); line-height: 26px; widows: 1;\">\r\n	&nbsp;</div>\r\n<div style=\"margin: 0px; padding: 0px; color: rgb(89, 87, 87); line-height: 26px; widows: 1;\">\r\n	&nbsp;</div>',NULL,NULL,'1');

