CREATE TABLE `cms_huiyuan` (
  `id` varchar(192) COLLATE utf8_bin DEFAULT NULL,
  `mobile` varchar(192) COLLATE utf8_bin DEFAULT NULL COMMENT '手机号',
  `username` varchar(300) COLLATE utf8_bin DEFAULT NULL COMMENT '姓名',
